👇👇👇
*Fui anotando conforme ele falava:*
1 - vim pra ouvir o povo;
2 - devo lealdade ao povo brasileiro;
3 - o povo voltou a admirar a Bandeira, acreditar que o País tem jeito;
4 - a missão é unir;
5 - sou o chefe supremo das Forças Armadas;
6 - as FFAA são o último obstáculo para o comunismo e devem lealdade ao povo, sao responsáveis pela nossa liberdade;
7 - sao decisões dificeis e dolorosas;
8 - se der errado é pq ele perdeu a liderança;
9 - nao critiquem sem ter certeza absoluta do que está acontecendo;
10 - todo mundo sabe o que aconteceu ao longos dos anos e o que foi anunciado pelo TSE;
11 - absurdos que estão acontecendo na nossa pátria;
12 - é fácil instalar uma ditadura no brasil;
13 - quem decide meu futuro e quem decide para onde vai as FFAA são voces (povo);
14 - só posso ser feliz se vcs forem felizes;
15 - "Não é eu autorizo", eu faço o que posso, não pode jogar a responsabilidade em uma pessoa só;
16 - 40 dias em silencio, dói na alma;
17 - nunca vi um povo ir às ruas para um presidente ficar, mas sim pra tirar, é a primeira vez que vejo;
18 - nada está perdido;
19 - acredito que a vitória será da mesma maneira, dentro das 4 linhas;
20 - dou minha vida pela minha Pátria;
21 - vamos nos dedicar, nos unir e buscar alternativas, e ver o que cada um pode fazer pela sua Pátria;
22 - vamos vencer;
23 - manifestação é democrática e voces sao cidadãos de verdade e já chega de serem tratados como estao sendo; e
24 - tudo vai dar certo em momento oportuno.
“NADA ESTÁ PERDIDO”
“VAMOS VENCER”
“O PODER EMANA DO POVO”
“TUDO NA SUA HORA!”

Essas foram algumas palavras!! Ditas de forma direta!!
Agora quem tiver disposição e vontade, vai pra frente dos quartéis ajudar as pessoas que lá estão. Temos que dar um voto de confiança!
Botei Fé na Fala do PR. Falou com força e convicção!

UM TEXTO MUITO RICO E QUE MERECE SER ESTUDADO E NÃO LIDO APENAS
____________________________________________________
O que é Desinformação com alto poder de engajamento? 
    R: Nove verdades com uma mentira get. 

O que faz uma mentira get neste momento? 

1. Desmotivar os patriotas;
2. Achar que o jogo já está resolvido; 
3. Definir datas finais; 
4. Construir no subconsciente que têm pessoas decidindo sobre o povo; 
5. Que a nossa luta depende da caneta do Presidente;
6. Que a democracia é o povo defender um lado político (direita x esquerda), ao invés de defender o seu próprio lado e a pátria; 
7. Que jornalista tal revelou uma verdade bombástica. Jornalistas nunca revelam verdades; eles revelam o jogo de quem paga mais. Não existem generais traidores. 
8. Coleta de assinaturas e petições como possíveis soluções.  Isso nunca deu em nada. 
9. Grupos que vão te ajudar a sofrer menos no Apocalipse porque divulgarão informações vitais (reduto on line de conservadores - na Alemanha formaram os guetos para ajuntar todos). Nunca divulgue os teus dados para grupos/sites de "conservadores".  
10. Defender pessoas, políticos ou partidos vai ajudar você vencer em grupo. A antiga expressão "união faz a força"... não é bem verdade. União faz açúcar. Se você se unir com o inimigo, você neutraliza a tua força. Não lute por pessoas, políticos ou partidos. Lute pelo ppvo e pelo Brasil. 
11. Que nós estamos limitados à constituição, e não à nossa legitimidade de poder constituinte.
